export default function Weather() {
  return (
    <div className="weather-app">
      <form>
        <div className="row">
          <div className="col-9">
            <input
              type="Search"
              placeholder="Enter city..."
              className="form-control"
            />
          </div>
          <div className="col-3"></div>
          <input type="Submit" value="Search" className="btn btn-primary" />
        </div>
      </form>
    </div>
  );
}
